import styled from "styled-components";
import BottomNavBar from "../../components/shared/BottomNavBar";
import {
  Container,
  MainBtn,
  ProcedureHeading,
  SelectionBox,
  SelectionMainText,
  SelectionSubText,
  colors,
} from "../../Styles";

interface Props {}

export default function BookingPage(props: Props) {
  return (
    <Container>
      <Heading>막걸리 찬가 놀러가기!</Heading>
      <SelectionBoxBooking>
        <SelectionMainText>다음주 수요일 오후 4시</SelectionMainText>
        <SelectionSubText>5명 참가예정</SelectionSubText>
      </SelectionBoxBooking>
      <SelectionBoxBooking>
        <SelectionMainText>다음주 수요일 오후 4시</SelectionMainText>
        <SelectionSubText>5명 참가예정</SelectionSubText>
      </SelectionBoxBooking>
      <Instruction>
        <InstructionHeading>식탁 모임은 이렇게 진행돼요!</InstructionHeading>
        <InstructionDetail>
          1. 같은 시간을 신청한 친구들과 4인/2인 랜덤 그룹을 만들어 드려요
          <br />
          2. 모임 당일 단톡을 만들어드려요! 친해지는 시간을 가져보세요
          <br />
          3. 지정된 장소와 시간에 만나서 놀아요:)
          <br />
        </InstructionDetail>
        <InstructionDetail>
          단톡이 만들어지기전에 적어주신 전화번호로 연락을 드릴게요!
        </InstructionDetail>
      </Instruction>
      <MainBtnBooking>놀러가기</MainBtnBooking>
      <BottomNavBar selectedItem="feed" />
    </Container>
  );
}

const Heading = styled(ProcedureHeading)`
  padding-top: 50px;
  margin-left: 30px;
`;

const SelectionBoxBooking = styled(SelectionBox)`
  margin-top: 30px;
`;

const MainBtnBooking = styled(MainBtn)`
  margin-top: 30px;
`;

const Instruction = styled.div`
  width: 90%;
  margin-left: auto;
  margin-right: auto;
  margin-top: 30px;
  min-height: 200px;
  background-color: #f8fafd;
  border-radius: 5px;
  display: content;
  justify-content: center;
  align-items: center;
  color: ${colors.MidGray};
`;

const InstructionHeading = styled.p`
  margin-top: 10px;
  margin-left:
  font-weight: bold;
  font-size: 13px;
  line-height: 16px;
`;

const InstructionDetail = styled.p`
  margin-top: 5px;
  font-weight: 500;
  font-size: 11px;
  line-height: 18px;
  letter-spacing: -0.005em;
`;
